import { css } from "@emotion/core";
import { Box, Grid, Table, TableCell, TableRow, Typography } from "@material-ui/core";
import Skeleton from "@material-ui/lab/Skeleton";
import React from "react";

const container = css`
    width: 100%;
`;

const header = css`
    width: 100%;
    margin-bottom: 40px;
`;

const table = css`
    width: 100%;
`;

const AppSkeleton = () => {
    const renderCell = () => (
        <TableCell>
            <Skeleton variant="rect" height={10} />
        </TableCell>
    );

    const renderRow = () => <>{renderCell()}</>;

    return (
        <div css={container}>
            <div css={header}>
                <Skeleton variant="rect" height={40} />
            </div>
            <div css={table}>
                <Table>
                    <TableRow>{renderCell()}</TableRow>
                </Table>
            </div>
        </div>
    );
};

export default AppSkeleton;
